import React from 'react';
import './Main.css';


export default (props) =>{


    return(
        <div className="container">
            <div className="col-12 mt-5 text-center Kevin">
                <h1>Hey, I'm Kevin</h1>
                <p>
                    I am a Full-stack web developer with experience in Python/Django, MERN, and C#/Asp.net 
                </p>
            </div>

        </div>
    )
};
